import React from 'react'
import { Carousel } from 'react-responsive-carousel';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import "../components/styles/imageGallery.css"


function ImageGallery({nameClass, object}) {

  const renderIndicator = (onClickHandler, isSelected, index, label) => {
    return (
      <li
        style={isSelected ? { backgroundColor: "#333" } : null}
        onClick={onClickHandler}
        key={index}
      >
        {`${index + 1} de ${label}`}
      </li>
    );
  };

  return (
    <Carousel className={nameClass} showThumbs={false} autoPlay infiniteLoop showArrows={false} renderIndicator={(currentIndex, total) => `${currentIndex + 1} de ${total}`}>   
                {object.imagenes.map((object) => (
                    <div><img src={object.url}/></div>
                ))}
    </Carousel>
  )
}

export default ImageGallery
